import { BrowserRouter, Route } from 'react-router-dom';
import Header from './Components/Header';
import HomePage from './Pages/HomePage';
import './App.css';

function App() {
  return (

      <BrowserRouter>
      <div>
       <Header/>
       <Route path="/" component={HomePage}/>
       <Route path="/coins/something" component={HomePage}/>
      </div>

      </BrowserRouter>

  );
}

export default App;
